// ButtonContainer.js
import React from 'react';
import './page2emr.css';

const buttonNames = [
    'Seizure',
    'Heart Attack',
    'Stroke',
    'Choke',
    'Sugar',
    'Blood',
    'Asthma',
    'Broken Stuff',
];
function nine(){
    return (<button className="oneone">
        Call 911
    </button>)
}
function ButtonContainer() {
    const buttons = buttonNames.map((name, index) => (
        <button key={index} className="button">
            {name}
        </button>
    ));

    return (
        <div className="button-container">
            {buttons}
        </div>
    );
}
function ninecontainer(){
    return(
        <div className="oneone">
            <nine/>
        </div>
    )
}
export default ButtonContainer;
